import urllib.request

n=0
def down(url, filename):
    filename = filename.replace("\\","")
    filename = filename.replace("/","")
    filename = filename.replace(":","")
    filename = filename.replace("?","")
    filename = filename.replace("\"","")
    filename = filename.replace("<","")
    filename = filename.replace(">","")
    filename = filename.replace("|","")
    

    try:
        # print(f"Ok: {filename}")
        urllib.request.urlretrieve(url, filename.replace("x200x200",""))
        # print(filename.replace("x200x200",""))
    except:
        print("erro: ",filename)


